var $bm_rt;
var damping, elasticity, simulation, speedLimit, elasticity, retard, poids, precision, tempsDebut, tempsRedemarrage, stop, arrete, i, tempsRedemarrage, tempsDebut, temps, frameRedemarre, valeur, valeur, valeur, spring, tempsClefProx, tempsDebut, tempsDebut, temps, spring, spring;
var fx = effect('Transformer Spring');
damping = fx(2).value;
elasticity = fx(1).value;
simulation = fx(3).value;
speedLimit = 0.1;
if (damping == 0)
    damping = 0.01;
if (elasticity == 0)
    elasticity = 0.01;
retard = $bm_div(elasticity, damping);
poids = $bm_div($bm_div(1, damping), 10);
$bm_rt = precision = thisComp.frameDuration;
function worldVelocity(temps) {
    var worldVelocityX, worldVelocityY;
    worldVelocityX = $bm_mul($bm_sub(thisLayer.toWorld(thisLayer.anchorPoint, temps)[0], thisLayer.toWorld(thisLayer.anchorPoint, $bm_sub(temps, 0.01))[0]), 100);
    worldVelocityY = $bm_mul($bm_sub(thisLayer.toWorld(thisLayer.anchorPoint, temps)[1], thisLayer.toWorld(thisLayer.anchorPoint, $bm_sub(temps, 0.01))[1]), 100);
    return [
        worldVelocityX,
        worldVelocityY
    ];
}
function worldSpeed(temps) {
    return length(worldVelocity(temps));
}
if (simulation == 2) {
    tempsDebut = 0;
    tempsRedemarrage = 0;
    stop = false;
    arrete = false;
    for (i = timeToFrames(time); i >= 0; i--) {
        var instant = framesToTime(i);
        var instantSuivant = $bm_sub(instant, precision);
        if (worldSpeed(instant) == 0) {
            if (tempsRedemarrage == 0)
                tempsRedemarrage = instant;
            if (worldSpeed(instantSuivant) != 0) {
                tempsDebut = instantSuivant;
                break;
            }
        }
    }
    temps = $bm_sub(time, tempsDebut);
    frameRedemarre = timeToFrames($bm_sub(time, tempsRedemarrage));
    $bm_rt = valeur = value;
    if (frameRedemarre <= retard)
        $bm_rt = valeur = $bm_sub(value, $bm_mul($bm_mul(worldVelocity(time), poids), $bm_div(frameRedemarre, retard)));
    else
        $bm_rt = valeur = $bm_sub(value, $bm_mul(worldVelocity(time), poids));
    if (worldSpeed(time) == 0) {
        spring = $bm_mul(worldVelocity(tempsDebut), $bm_div($bm_mul($bm_div(0.15, elasticity), Math.sin($bm_mul($bm_mul($bm_mul(elasticity, temps), 2), Math.PI))), Math.exp($bm_mul(temps, damping))));
        $bm_rt = $bm_sum(valeur, spring);
    } else {
        $bm_rt = valeur;
    }
} else {
    if (numKeys > 1 && elasticity != 0) {
        if (nearestKey(time).index == 1) {
            $bm_rt = value;
        } else {
            if (length(velocity) <= speedLimit) {
                tempsClefProx = nearestKey(time).time;
                if (tempsClefProx <= time) {
                    tempsDebut = tempsClefProx;
                } else {
                    tempsDebut = key($bm_sub(nearestKey(time).index, 1)).time;
                }
                temps = $bm_sub(time, tempsDebut);
                spring = $bm_mul(velocityAtTime($bm_sub(tempsDebut, thisComp.frameDuration)), $bm_div($bm_mul($bm_div(0.15, elasticity), Math.sin($bm_mul($bm_mul($bm_mul(elasticity, temps), 2), Math.PI))), Math.exp($bm_mul(temps, damping))));
                if (speedLimit > 0)
                    spring = $bm_mul(spring, $bm_sub(1, $bm_div(length(velocity), speedLimit)));
                $bm_rt = $bm_sum(valueAtTime(tempsDebut), spring);
            } else {
                $bm_rt = value;
            }
        }
    } else {
        $bm_rt = value;
    }
}

